[General]
ConfigVersion=2

[Browser]
AllowExpiredCredentials=true
Browser_AllowLocalhostWithPasskeys=true
CustomProxyLocation=
Enabled=true
SearchInAllDatabases=true

[FdoSecrets]
Enabled=true

[GUI]
ApplicationTheme=dark
ColorPasswords=false
CompactMode=true
HideUsernames=false
MinimizeOnStartup=false
ShowExpiredEntriesOnDatabaseUnlock=false
TrayIconAppearance=monochrome-light

[KeeShare]
Active="<?xml version=\"1.0\"?><KeeShare><Active/></KeeShare>\n"
Own="<?xml version=\"1.0\"?><KeeShare><PrivateKey></PrivateKey><PublicKey><Signer>leo</Signer><Key></Key></PublicKey></KeeShare>\n"
QuietSuccess=true

[PasswordGenerator]
AdditionalChars=
AdvancedMode=false
ExcludedChars=
Length=40
Logograms=true

[SSHAgent]
Enabled=true

[Security]
ClearClipboardTimeout=15
ClearSearch=true
IconDownloadFallback=true
LockDatabaseIdle=true
PasswordEmptyPlaceholder=true
Security_HideNotes=true
